import React, { Component } from 'react'
import header from './header.jpeg'

export default class Header extends Component {
    render() {
        return (
            <div>
                <img src={header} alt="header" style={{width:"100%"}}/>
                <input style={{width:"100%"}}></input>
            </div>
        )
    }
}
